import React from "react";
import rings from '../../images/shoes.png';
import './styles.css';

const Footer = () => {
    return (
        <div className="footer">
            <img  src={rings} alt="rings" />
            <span>Сайт построен Женихом</span>
        </div>
    );
};

export default Footer;
